import React, { useContext, useEffect, useState } from 'react';
import { Context } from '..';
import { observer } from 'mobx-react-lite';
import Footer from '../components/Footer';
import {Button} from 'react-bootstrap';
import {useNavigate} from 'react-router-dom'
// import {LOGIN_ROUTE, SHOP_ROUTE} from '../utils/consts';
import { Row, Col, Container } from "react-bootstrap";

const Home = observer(() => {
 
    const navigate = useNavigate()
    return (
        <div>
        <div className='bg'> 
             <Container maxWidth="lg">
            <Row className="mt-2">
            <Col md={12}>
          
      
        <div className='cont'>
          
          <div className='logohome'> Ресторан быстрого обслуживания </div>
          <div className='textone'> Место, где готовят с душой </div>
          <Button className='menubtn1'  variant={"outline-light"} 
             onClick={() => navigate()}
             style= {{color: '#D16002'}} 
              > 
              Ресторан
              <img className='iconmenu' src={"./img/Menu.png"} />
              </Button>
              
              <Button className='menubtn2'  variant={"outline-light"} 
              onClick={() => navigate()}
             style= {{color: '#D16002'}} 
              > 
              Авторизация
              </Button>
            
           </div> 
           </Col> 
           </Row>
           <Row className="mt-2">
           <Col md={12}>
          
           </Col>
           </Row>
           <div className='cont'>
        <Row className="mt-2">
        <Col md={12}>
        
        <Footer/>
        </Col>
        </Row>
        </div>
           </Container>
           
           </div>
       
        </div>
    );
   
});



export default Home;
